  useEffect(() => {
    if (userId) {
      console.log('ID do usuário:', userId);
      // Aqui, você pode fazer a chamada à API ou buscar os dados do usuário.
    }
  }, [userId]);

  return (
    <div>
      <h2>Soluções do Usuário</h2>
      {/* Renderize as soluções aqui */}
    </div>
  );
};

export default SolucoesUsuario;
